	'mwe-upwiz-thanks-wikitext' => '<b>ଏକ ଉଇକିରେ ବ୍ୟବହାର ହେବାପାଇଁ</b>, ଏହି ଲେଖାକୁ ଏକ ପୃଷ୍ଠାକୁ ନକଲ କରିନିଅନ୍ତୁ:',
