	'mwe-upwiz-fileexists-replace-on-page' => 'ଏହି ନାମରେ ଆଗରୁ ଫାଇଲଟିଏ ରହିଅଛି । ଯଦି ଆପଣ ଏହାକୁ ପ୍ରତିବଦଳ କରିବାକୁ ଚାହାନ୍ତି ତେବେ [$2 $1] ନିମନ୍ତେ ପୃଷ୍ଠାକୁ ଯାଇ ସେଠାରେ ପ୍ରତିବଦଳ କରନ୍ତୁ ।',
