	'mwe-upwiz-tooltip-source' => 'ଡିଜିଟାଲ ଫାଇଲଟି କେଉଁଠାରୁ ଆସିଛି - ଏହା ଏକ URL, ବହି ବା ପ୍ରକାଶନ ହୋଇଥାଇପାରେ ।',
