	'mwe-upwiz-tooltip-title' => 'ଫାଇଲଟି ପାଇଁ ଏକ ନିଆରା ବର୍ଣ୍ଣନାତ୍ମକ ନାମ, ଯାହା ଫାଇଲନାମ ଭାବରେ କାମ କରିବ । ଆପଣ ସାଧାରଣ ଭାଷାରେ ଶୂନ୍ୟସ୍ଥାନ ଦେଇ ବି ଲେଖିପାରନ୍ତି । ଏଥିରେ ଫାଇଲ ଏକ୍ସଟେନସନ ଯୋଡ଼ନ୍ତୁ ନାହିଁ ।',
